// src/Sidebar.js
import React from 'react';
import './Sidebar.css';

const SideMenu = () => {
  return (
    <div className='sidebar'>
      <ul>
        <li><a href="#home">Home</a></li>
        <li><a href="#services">Services</a></li>
        <li><a href="#about">About</a></li>
        <li><a href="#contact">Contact</a></li>
      </ul>
    </div>
  );
};

export default SideMenu;
